import './App.css';
import AddList from './component/addElementList';
import Title from './component/title';
import SearchW from './component/searchWord';

function App () {
 const lista =[]; 
  function copyList(e){
      lista.push(AddList.lists);
  }

return (
  <p>
    <Title />
    <AddList name="copyList"/>
    <SearchW />
  </p>
);
}
export default App;
